INSERT INTO `about` (`about_id`, `description`, `ceo_msg`, `about_name`, `about_img`, `img`, `about_date`, `heading`) VALUES
(1, '<h2><em><strong>Company Profile</strong></em></h2>\r\n\r\n<p>The Punjab Educational Endowment Fund (PEEF) under guidance of the Board of Directors is providing opportunities to the talented but needy students to fulfill their dreams and aspirations and at the same time to become partner in the development and welfare of Pakistan.</p>\r\n\r\n<p>The PEEF, since its inception in 2009 has awarded more than 380,000 scholarships to students of Punjab and other provinces which are currently pursuing education through public and private sector institutions and Centre of Excellence like LUMS, NUST, FAST, IBA Karachi, GIKI Swabi, etc.</p>\r\n\r\n<p><br />\r\n<em><strong>VISION</strong></em><br />\r\nCreation of a pool of talented Pakistani youth from less privileged background; contributing towards economic and social development, to realize the dream of a moderate, progressive and prosperous Pakistan.<br />\r\n<br />\r\n<strong><em>MISSION</em></strong>Building a critical mass of human capital, participating in nation building; through the provision of equitable opportunities to the less privileged but academically brilliant girls and boys in Punjab.</p>\r\n', '<h2><em><strong>CEO Message</strong></em></h2>\r\n\r\n<p>I am humbled to share that the Punjab Educational Endowment Fund (PEEF) has awarded more than 380,000 scholarships in a period of eleven years with an endowment fund of Rs 13.48 Billion. The transformative impact of PEEF is inspirational - not only has it provided financial assistance to deserving and talented students, it has equipped them as socioeconomic agents of change in their respective field.<br />\r\n<em><strong>VISION</strong></em><br />\r\nIn the coming months, PEEF aspires to expand its endowment so that it can continue to improve its targeting and thus its scholarships.&nbsp;<br />\r\n<br />\r\n<strong><em>MISSION</em></strong></p>\r\n\r\n<p>Scholarship for talented and less privileged students to bring them at par with the more fortunate ones. Creation of a critical mass of talented youth for the development of society</p>\r\n', 'Muhammad Ahsan', 'images/4903947622_download.png', 0x696d616765732f323832313234303130345f616c6578616e6465722e6a7067, '2018-06-10 16:43:15', 'WELCOME TO Scholarship For YOur Bright FUTURE'),
(2, '<p>Why do we use it?</p>\r\n\r\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Why do we use it?</h2>\r\n', '<p>Candid Pharmaceuticals was established in 1998. We are manufacturing medicines and bringing forth a variety of pharmaceuticals products in the form of oral dosage and injectables. We, being a WHO cGMP compliant and ISO 9001-2008 certified company have our business set ups(distributional and promotional) all over Pakistan. Moreover, we are also exporting products to other countries and delivering uncompromising quality around the globe.&nbsp;<br />\r\n<br />\r\nVISION<br />\r\nTo become global player in pharmaceuticals industry to facilitate the access of common person to excellent quality medicines at affordable price across the globe.&nbsp;<br />\r\n<br />\r\nMISSION<br />\r\nTo achieve our goal by producing high tech pharmaceuticals products in accordance with cGMP (current Good Manufacturing Practices) recommended by the WHO and access to the global market, to make our products available at competitive price.</p>\r\n', 'Muhammad Ahsan', 'images/7589490428_321127479_4143243921_1042fffd4808c6dae90ef972c4cb31d5 - Copy.jpg', '', '2018-06-10 16:43:46', 'WELCOME TO tyche ecommerce store');

